import './App.css';
import Game from './components/Game';
import './assets/css/foundation.css';

function App() {
  return (
    <div className="App">
    <div className="bg"></div>
      <div className="grid-container">
        <div className="grid-x grid-padding-x">
          <div className="large-12 cell">
            <Game />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
